wd.dianxinUnion.cookie = {
    set: function(n, v, t) {
        var Days = 0.5;
        var exp = new Date();
        typeof t == 'undefined' ? exp.setTime(exp.getTime() + Days * 24 * 60 * 60 * 1000) : exp.setTime(exp.getTime() + t * 1000 * 60);
        document.cookie = n + "=" + escape(v) + ";expires=" + exp.toGMTString() + ";path=/";
    },
    get: function(n) {
        var arr = document.cookie.match(new RegExp("(^| )" + n + "=([^;]*)(;|$)"));
        return arr != null ? unescape(arr[2]) : null;
    },
    del: function(n) {
        var exp = new Date();
        exp.setTime(exp.getTime() - 1);
        var cval = this.getCookie(n);
        if (cval != null) document.cookie = n + "=" + cval + ";expires=" + exp.toGMTString();
    }
};
